import React, { Component } from "react";
import "./index.css"
export default class List extends Component {
  state={
    user:[
        {id:1,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:2,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:3,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:4,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:5,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:6,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:7,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:8,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:9,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"},
        {id:10,src:"https://pic.ntimg.cn/file/20190819/29521808_152255405869_2.jpg"}     
    ]
  }
  render() {
    const {users,isFirst,isLoading,err}=this.props
    return <div className="cs-List-x">
              { 
                isFirst?<h2>Welcome to research</h2>:
                isLoading?<h2>Loading...</h2>:
                err>
                this.props.users.map((item)=>{
                    return (
                      <div className="cs-List-img-x" key={item.id}>
                        <a href={item.html_url} className="cs-List-navi" >
                            <img src={item.avatar_url} className="cs-List-img"/>
                        </a>
                        <p className="cs-List-img-p"> {item.login}</p>
                      </div>
                    )
                })}
            </div>;
            //{this.sta}
  }
}
